import { createMuiTheme } from "@material-ui/core";
import orange from "@material-ui/core/colors/orange";

export default createMuiTheme({
  palette: {
    primary: black,
    secondary: {
      main: '#FFFFFF',
    }
  }
});

const theme = createMuiTheme({
  palette: {
    primary: {
      light: '#757ce8',
      main: '#3f50b5',
      dark: '#002884',
      contrastText: '#fff',
    },
    secondary: {
      light: '#ff7961',
      main: '#f44336',
      dark: '#ba000d',
      contrastText: '#000',
    },
  },
});
